import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav style={{ background: "#222", padding: "10px" }}>
      <Link to="/" style={{ color: "#fff", marginRight: "15px" }}>Inicio</Link>
      <Link to="/cart" style={{ color: "#fff", marginRight: "15px" }}>Carrito</Link>
      <Link to="/dashboards" style={{ color: "#fff", marginRight: "15px" }}>IoT Dashboards</Link>
      <Link to="/admin" style={{ color: "#fff" }}>Admin</Link>
    </nav>
  );
}

export default Navbar;
